import base64
import zlib

encoded_data_string = ""

try:
    decoded_bytes = base64.b64decode(encoded_data_string)
    decompressed_bytes = zlib.decompress(decoded_bytes)
    
    # Get the first 32 bytes of the decompressed data
    header_bytes = decompressed_bytes[:32]
    
    # Print the bytes in a readable hexadecimal format
    hex_representation = ' '.join(f'{byte:02x}' for byte in header_bytes)
    
    print("Successfully decompressed the data.")
    print("Here are the first 32 bytes in hexadecimal format:")
    print(hex_representation)
    
except Exception as e:
    print(f"An unexpected error occurred: {e}")